import Jordan from '../components/pages/Jordan/Jordan';
import NewBalance from '../components/pages/NewBalance/NewBalance';
import Nike from '../components/pages/Nike/Nike';
import NikeSB from '../components/pages/NikeSB/NikeSB';
import ProductPage from '../components/pages/ProductPage/ProductPage';
import MainPage from '../components/pages/MainPage/MainPage';

export const routes = [
    { path: '/', element: <MainPage /> },
    { path: '/brands/nike', element: <Nike /> },
    { path: '/brands/nike-sb', element: <NikeSB /> },
    { path: '/brands/new-balance', element: <NewBalance /> },
    { path: '/brands/jordan', element: <Jordan /> },
    { path: '/:silhouette-:color-:vendorCode', element: <ProductPage /> }
];
